script: |
  super -f text -I q9432.spq | sort > q9432.out

inputs:
  - name: q9432.spq
    data: |
      SELECT DISTINCT col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT ( - col1 ) BETWEEN ( + col2 * + col2 ) AND 55 * + col0 * + col1;
  - name: tab1

outputs:
  - name: q9432.out
    data: |
      51
      85
      91
